summary:
There is more than one artist with this name, including: 

1) Lucius is an American five-piece indie pop-band from Brooklyn, New York formed in 2011; 
2) Lucius was a Swedish band from Norrköping, Sweden, formed in 1999; 
3) Lucius was a Latvian band formed in 1996. 

1) Lucius is an American five-piece indie pop-band from Brooklyn, New York formed in 2011. The band consists of Jess Wolfe (lead vocals and synth), Holly Laessig (lead vocals and keys) <a href="https://www.last.fm/music/Lucius">Read more on Last.fm</a>
